import React from "react";

function Character({ chars, loading }: any) {
  if (loading) {
    return <h2>Loading...</h2>;
  }

  return (
    <ul>
      {chars.map((chars: any) => (
        <li key={chars.id}>{chars.name}</li>
      ))}
    </ul>
  );
}

export default Character;
